import React from 'react';
import classNames from 'classnames';
import { Link } from 'react-router-dom';
import Image from '../../elements/Image';

const Logo = ({
  className,
  ...props
}) => {

  const classes = classNames(
    'brand',
    className
  );

  return (
    <div
      {...props}
      className={classes}
    >
      <h1 className="m-0">
        <Link to="/">
          <image
            src={require('./../../../../assets/images/logo.png')}
            alt="gf"
            height={32}
            width={120} />
        </Link>
      </h1>
    </div>
  );
}

export default Logo;
